class Payment{
    constructor(amount, paidAt, paidBy, paidOn, description){
        this.amount = amount;
        this.paidAt = paidAt;
        this.paidBy = paidBy;
        this.paidOn = paidOn;
        this.description = description;
    }
}

export default Payment;
